result:
query($id: ID!) {
   author(id: $id) {
     title
     path
     image
     blurb
     content
     belongsTo {
       totalCount
       pageInfo {
         totalPages
         currentPage
       }
       edges {
         node {
           ... on Post {
             id
             title
             excerpt
             featuredImage
             path
             content
             date(format:"MMMM Do YYYY")


             author {
               id
               title
               image
               path
             }
           }
         }
       }
     }
   }  
 }
